import axios from "axios";

const baseURL = "http://localhost:21309/api/";

export default function GetIdUser(EMail, UserPassword) {
  debugger;
  axios
    .get(
      `${baseURL}ShoppingCart/Login${EMail}/${shoppingCart.UserPassword}`
    )
    .then(function (response) {
      shoppingCart.idUser = response.data;
    })
    .catch(function (error) {
      // handle error
      console.log(error);
    })
    .then(function () {
      // always executed
    });
}
